import './App.css';

export default class App extends React.Component {
  person = () => {
    console.log('Hello');
  };

  render() {
    const styles = {
      border: '3px solid black',
      width: '400px',
      height: '20px',
      background: 'rgba(0, 0, 0, 0.322)',
    };
    return (
      <div className='App'>
        <div className=''></div>
        <input type='text' style={styles} onclick={this.props.person} />
      </div>
    );
  }
}
